import React from "react";
import { Link } from "react-router-dom";
import '../assets/style/Games.css'
import { Navbar } from '../components'

type gameType = {
    id: string,
    name: string,
    logo: string,
    info: string,
    min: number,
    max: number
}

export default function Games(){

    const games = [
        {"name": "Secret Hitler", "min": 5, "max": 10, "info": "abcsabd asdasd asdasd asdasda dsad asd asd asd"
            , "logo": "SH", "id":"SH"
        },
        {"name": "Castle Wars", "min": 2, "max": 2, "info": "abcsabd asdasd asdasd asdasda dsad asd asd asd"
            , "logo": "CW", "id":"CW"
        }
    ]

    function gameDiv(game: gameType){
        return <tr id={game.id}>
            <td className="logo">
                {game.logo}
            </td>
            <td className="title">
                {game.name + `    (${game.min}-${game.max})`}
            </td>
            <td className="info">
                {game.info}
            </td>
        </tr>
    }

    return <>
    <Navbar></Navbar>
    <table className="gameslist"><tbody>
        {games.map(game => {
            return gameDiv(game)
        })}
    </tbody></table>        
    </>
}
